    };
  },
  methods: {
    onSubmit(index,type,price){
      // this.$alert(" 预定成功","提示", {
      //   confirmButtonText: "确定",

      // })
      console.log(md5('101151123412347tJsupCChsVpRHz4PxxjOtMuAeigUn47'));
      console.log(type);
      this.$router.push({
        path:`/tickets/order`,
        query:{
          vehicle:JSON.stringify(this.tableData[index]),
          seat_type:type,
          price:price,
          date:this.formInline.departure_date
        }
      })
     console.log(index);
    },
   
 newQuery() {
      if (
        this.formInline.ticket_type &&
        this.query_departure_trainstation &&
        this.query_departure_trainstation &&
        this.formInline.departure_date
      ) {
        if(this.formInline.ticket_type=="火车票"){

          this.$router.push({
          path: `/tickets/trainquery`,
          query: {
            from: this.query_departure_trainstation,
            to: this.query_arrival_trainstation,
            date: this.formInline.departure_date,
          },
        });
      } 
        else {
          this.$router.push({
            path: `/tickets/planequery`,
            query: {
              from: this.query_departure_trainstation,
              to: this.query_arrival_trainstation,
              date: this.formInline.departure_date,
            },
          });
        }
        
      }
     else {
        this.$alert("请填写所有选项再查询", "提示", {
          confirmButtonText: "确定",
        });
        }
    },
    querySearch1(queryString, cb) {
      var city1 = this.departure_trainstation_list;
      var results = queryString
        ? city1.filter(this.createFilter(queryString))
        : city1;
      // 调用 callback 返回建议列表的数据
      cb(results);
    },
    querySearch2(queryString, cb) {
      var city2 = this.departure_trainstation_list;
      var results = queryString
        ? city2.filter(this.createFilter(queryString))
        : city2;
      // 调用 callback 返回建议列表的数据
      cb(results);
    },
    createFilter(queryString) {
      return (city) => {
        return (
          //city.value.toLowerCase().indexOf(queryString.toLowerCase()) != -1
          city.value.toLowerCase()
          .indexOf(queryString.toLowerCase()) != -1
        );
      };
    },

    typechange(val) {
      if (val == "2") {
        this.holder="一等座";

      } else {
        this.holder="经济舱";

      }
    },
    sort(){

      if(this.sort_prior=="1")this.tableData=JSON.parse(JSON.stringify(this.defult_tabledata));
      else if(this.sort_prior=="2"){
        this.tableData=JSON.parse(JSON.stringify(this.defult_tabledata));
      this.tableData.sort( function ( a , b ){ 
        return  a.origin_drive_time.localeCompare(b.origin_drive_time) } );}
      else {
        this.tableData=JSON.parse(JSON.stringify(this.defult_tabledata));
        this.tableData.sort( function ( a , b ){ return  b.drive_time - a.drive_time } );
        //this.tableData.reverse();
      }
    },
    filt(){
      if(this.train_type){
        this.tableData=JSON.parse(JSON.stringify(this.originalData));
        this.tableData=this.tableData.filter(function (value) {
        return value.vehiclE_ID[0]=="G"||value.vehiclE_ID[0]=="D";
        });
        this.defult_tabledata=JSON.parse(JSON.stringify(this.tableData));;

      }
      else {
        this.tableData=JSON.parse(JSON.stringify(this.originalData));
        this.defult_tabledata=JSON.parse(JSON.stringify(this.originalData));
        this.sort();
      }
    },
    to_this_attraction(x){
      this.$router.push({
          path: "/attraction/detail",
          query: { id: x },
        });
    },
      to_this_hotel(x){
      this.$router.push({
        path: "/hotel/detail",
        query: { id: x },
        });
    },
    more(opt){
      if(opt==1){
        this.$router.push({
        path: "/hotel/city",
        query: { find: this.query_arrival_trainstation },
      });
      }
      else {
        this.$router.push({
        path: "/attraction/city",
        query: { search: this.query_arrival_trainstation },
      });
      }
    },
async sleeping(time){
 return new Promise((resolve) => setTimeout(resolve, time));
},
  },
  
  
  async mounted() {
 
    document.getElementById("loading").style.visibility="visible";
    let _this=this;
    this.formInline.ticket_type="火车票";
    this.query_departure_trainstation=this.$route.query.from;
    this.query_arrival_trainstation=this.$route.query.to;
    this.formInline.departure_date=this.$route.query.date;
    this.$axios
        .get(
        "http://49.234.18.247:8080/api/FunGetCommentNumByHotelLocation/" +
          this.query_arrival_trainstation
      )
      .then((response) => {
        var temp_hotel = response.data.sort(function (a, b) {
          return b.star - a.star;
        });
        this.hotels=temp_hotel.slice(0,2);
      })
      this.$axios
        .get(
        "http://49.234.18.247:8080/api/FunGetCommentNumByAttLocation/" +
          this.query_arrival_trainstation
      )
      .then((response) => {
        var temp_hotel = response.data.sort(function (a, b) {
          return b.star - a.star;
        });
